// Use the workspaceId from the before hook
cy.wrap(workspaceId).should('exist'); // Ensure workspaceId is available
// Step 1: Create Space via API
cy.createSpace(workspaceId, token).then(response => {
  expect(response.status).to.eq(200);
  // Fetch Space ID and Space Name from the API
  cy.getSpaceId(workspaceId).then(result => {
    spaceId = result.id;
    spaceName = result.name;
    cy.log('Space ID:', spaceId);
    cy.log('Space Name:', spaceName);
    // Step 2: Login to Web Application and Validate Space
    cy.visit('https://app.clickup.com/');
    cy.get('input[id="login-email-input"]').type('creationsvski@gmail.com');
    cy.get('input[id="login-password-input"]').type('Example1978');
    cy.get('button[class="login-page-new__main-form-button"]').click();
    // Validate the URL contains the spaceId
    cy.url({
      timeout: 35000
    }).should('include', spaceId);
  });
});
